/**
 * Script de Texto Flutuante (Damage Numbers / Popups)
 * Permite exibir textos que sobem e somem (ex: Dano, XP, Falas)
 * 
 * Uso:
 * const txt = entidade.obterComponente('ScriptComponent').instance;
 * txt.spawn("100", "red");
 * txt.spawn("Level Up!", "gold", 0, -50);
 */
class FloatingTextScript {
    constructor(entidade) {
        this.entidade = entidade;
        this._textos = []; // Lista de textos ativos {x, y, text, color, life, maxLife, velocityY}
    }

    /**
     * Cria um novo texto flutuante
     * offsetX/Y são relativos ao centro da entidade
     */
    spawn(texto, cor = 'white', offsetX = 0, offsetY = 0) {
        if (!this._textos) this._textos = [];
        console.log('[FloatingText] Spawning:', texto); // Debug Log
        this._textos.push({
            text: texto,
            color: cor,
            x: offsetX, // Relativo
            y: offsetY, // Relativo
            life: 1.0,  // Duração em segundos
            maxLife: 1.0,
            velocityY: -50, // Velocidade de subida (px/s)
            scale: 1.0
        });
    }

    /**
     * Helper para exibir dano (Vermelho)
     */
    mostrarDano(valor) {
        this.spawn("-" + valor, "#ff3333", 0, -20);
    }

    /**
     * Helper para curas (Verde)
     */
    mostrarCura(valor) {
        this.spawn("+" + valor, "#33ff33", 0, -20);
    }

    atualizar(dt) {
        // Atualizar textos e remover expirados
        for (let i = this._textos.length - 1; i >= 0; i--) {
            let t = this._textos[i];
            t.life -= dt;
            t.y += t.velocityY * dt; // Sobe

            // Opcional: Efeito de escala/fade
            if (t.life < 0) {
                this._textos.splice(i, 1);
            }
        }
    }

    renderizar(ctx) {
        if (!this._textos || this._textos.length === 0) {
            // console.log('[FloatingText] Nada para renderizar.');
            return;
        }

        ctx.save();
        // ctx já está transformado para a posição da entidade?
        // Entidade.js: ctx.translate não é chamado antes do loop genérico!
        // O ctx está nas coordenadas do MUNDO (Camera aplicada).
        // Então desenhamos em this.entidade.x + t.x

        ctx.font = "bold 20px monospace";
        ctx.textAlign = "center";

        const centroX = this.entidade.x + (this.entidade.largura / 2);
        const centroY = this.entidade.y; // Topo da entidade ou centro?

        for (const t of this._textos) {
            // Calcular Alpha baseada na vida
            const alpha = Math.max(0, t.life / t.maxLife);

            ctx.globalAlpha = alpha;
            ctx.fillStyle = t.color;
            ctx.strokeStyle = "black";
            ctx.lineWidth = 3;

            const posX = centroX + t.x;
            const posY = centroY + t.y; // Y é relativo ao topo aqui

            ctx.strokeText(t.text, posX, posY);
            ctx.fillText(t.text, posX, posY);
        }

        ctx.restore();
    }
}

// PLATFORMER SCRIPT v6.0 AUDIO-INTEGRATED
class MovimentacaoPlataformaScript {
  constructor(entidade) {
    this.entidade = entidade;
    // === MOVIMENTO ===
    this.velocidade = 200;
    this.velocidadeCorrida = 360;
    this.forcaPulo = 600;
    this.distanciaParede = 5;
    this.velocidadeWallSlide = 150;
    // === VISUAL OFFSETS ===
    this.offsetWallEsq = 0;
    this.offsetWallDir = 0;
    // === AUDIO (Propriedades Editaveis) ===
    this.somAndar = "";
    this.pitchAndar = 1.0;
    this.somCorrida = "";
    this.pitchCorrida = 1.0;
    this.somPulo = "";
    this.pitchPulo = 1.0;
    this.somPousar = "";
    this.pitchPousar = 1.0;
    this.somWallSlide = "";
    this.pitchWallSlide = 1.0;
    // Controle Interno de Audio
    this.audioAndarInstancia = null;
    this.audioCorridaInstancia = null;
    this.audioWallSlideInstancia = null;
    this.foiNoChao = true;
    this.paredeEsq = false;
    this.paredeDir = false;
    // Capture default visual offset
    const sc = this.entidade.obterComponente("SpriteComponent");
    let def = sc ? sc.offsetX : 0;
    if (isNaN(def)) def = 0;
    this.defaultOffsetX = def;
    this.entidade.temGravidade = true;
    if (!this.entidade.gravidade) this.entidade.gravidade = 1200;

    // [Collision Dynamic Init]
    this._defH = 0; this._crouchH = 0; this._defOffY = 0; this._crouchOffY = 0;
    const col = this.entidade.obterComponente("CollisionComponent");
    if(col) {
        this._defH = col.altura; this._crouchH = col.altura * 0.5;
        this._defOffY = col.offsetY; this._crouchOffY = col.offsetY + (col.altura * 0.5);
    }
  }
  // --- AUDIO HELPER ---
  tocarSom(id, loop = false, controlsRef = null, pitch = 1.0) {
      if (!id || !window.AudioManager) return null;
      // Se já tem uma instância tocando e queremos loop, verifica se precisa atualizar pitch
      if (loop && controlsRef && controlsRef.playing) {
           if (controlsRef.setRate) controlsRef.setRate(pitch);
           return controlsRef;
      }

      const ctrl = window.AudioManager.play(id, 1.0, loop, pitch);
      if (loop && ctrl) ctrl.playing = true;
      return ctrl;
  }

  pararSom(controlsRef) {
      if (controlsRef) {
          controlsRef.stop();
          controlsRef.playing = false;
      }
  }

  detectarParedes() {
    this.paredeEsq = false; this.paredeDir = false;
    if (!this.entidade.engine) return;
    const tilemapEntities = this.entidade.engine.entidades.filter(e => e.obterComponente("TilemapComponent"));
    if (tilemapEntities.length === 0) return;

    const colComp = this.entidade.obterComponente("CollisionComponent");
    if (!colComp) return;
    const bounds = colComp.obterLimitesAbsolutos(this.entidade);
    const checkDist = this.distanciaParede; const marginY = 4;
    const sensorTop = bounds.y + marginY;
    const sensorBottom = bounds.y + bounds.h - marginY;
    const sensorLeft = bounds.x - checkDist;
    const sensorRight = bounds.x + bounds.w + checkDist;

    for (const tmEntity of tilemapEntities) {
      const tileComp = tmEntity.obterComponente("TilemapComponent");
      const tileSize = tileComp.tileSize * tileComp.scale;
      const tilemapX = tmEntity.x || 0;
      const tilemapY = tmEntity.y || 0;

      const startCol = Math.floor(((bounds.x - checkDist) - tilemapX) / tileSize);
      const endCol = Math.floor(((bounds.x + bounds.w + checkDist) - tilemapX) / tileSize);
      const startRow = Math.floor((sensorTop - tilemapY) / tileSize);
      const endRow = Math.floor((sensorBottom - tilemapY) / tileSize);

      for (let r = startRow; r <= endRow; r++) {
        for (let c = startCol; c <= endCol; c++) {
          const tile = tileComp.getTile(c, r);
          if (!tile) continue;
          const tileX = tilemapX + c * tileSize;
          const tileY = tilemapY + r * tileSize;
          if (!tile.solid && !tile.wall && !tile.ground) continue;
          const overlapsY = (sensorTop > tileY && sensorTop < tileY + tileSize && sensorBottom > tileY);
          if (!overlapsY) continue;
          if (tileX + tileSize > sensorLeft && tileX < bounds.x) this.paredeEsq = true;
          if (tileX < sensorRight && tileX + tileSize > bounds.x + bounds.w) this.paredeDir = true;
        }
      }
    }
  }

  obterScriptPorNome(nomeDaClasse) {
    for (const [key, comp] of this.entidade.componentes) {
      if (key.startsWith("ScriptComponent") && comp.scriptName === nomeDaClasse) return comp.instance;
    }
    return null;
  }

  processarInput(input, deltaTime) {
    const attackScript = this.obterScriptPorNome("CombateMeleeScript");
    const isAttacking = attackScript && attackScript.estaOcupado && attackScript.estaOcupado();
    if (isAttacking) { 
         // Ao atacar, paramos o som de andar/corrida
         this.pararSom(this.audioAndarInstancia); this.audioAndarInstancia = null;
         this.pararSom(this.audioCorridaInstancia); this.audioCorridaInstancia = null;
         return;
    }

    const noChao = this.entidade.noChao;

    // SOM: Pousar
    if (!this.foiNoChao && noChao) this.tocarSom(this.somPousar, false, null, this.pitchPousar);
    this.foiNoChao = noChao;

    this.detectarParedes();
    let vx = 0;
    const correndo = input.teclaPressionada("Shift");
    const pressEsq = input.teclaPressionada("a") || input.teclaPressionada("A") || input.teclaPressionada("ArrowLeft");
    const pressDir = input.teclaPressionada("d") || input.teclaPressionada("D") || input.teclaPressionada("ArrowRight");
    const pressDown = input.teclaPressionada("s") || input.teclaPressionada("S") || input.teclaPressionada("ArrowDown");
    const pressJump = input.teclaPrecionadaAgora(" ") || input.teclaPrecionadaAgora("w") || input.teclaPrecionadaAgora("W") || input.teclaPrecionadaAgora("ArrowUp");

    let velAtual = this.velocidade;
    if (pressDown && noChao) velAtual = this.velocidadeAgachado || (this.velocidade * 0.5);
    else if (correndo) velAtual = this.velocidadeCorrida;
    if (isNaN(velAtual)) velAtual = this.velocidade;

    if (pressEsq) vx = -velAtual;
    if (pressDir) vx = velAtual;
    if (isNaN(vx)) vx = 0;
    this.entidade.velocidadeX = vx;

    // --- SOM: Andar / Correr ---
    if (noChao && vx !== 0) {
        if (correndo && this.somCorrida) {
            // Toca Correr, para Andar
            this.pararSom(this.audioAndarInstancia); this.audioAndarInstancia = null;
            this.audioCorridaInstancia = this.tocarSom(this.somCorrida, true, this.audioCorridaInstancia, this.pitchCorrida);
        } else {
            // Toca Andar, para Correr
            this.pararSom(this.audioCorridaInstancia); this.audioCorridaInstancia = null;
            this.audioAndarInstancia = this.tocarSom(this.somAndar, true, this.audioAndarInstancia, this.pitchAndar);
        }
    } else {
        this.pararSom(this.audioAndarInstancia); this.audioAndarInstancia = null;
        this.pararSom(this.audioCorridaInstancia); this.audioCorridaInstancia = null;
    }

    // ANIMACAO & ESTADO
    const spriteComp = this.entidade.obterComponente("SpriteComponent");
    const anims = spriteComp ? spriteComp.animacoes : {};
    const hasAnim = (name) => anims && (anims[name] || anims[name.toLowerCase()] || anims[name.toUpperCase()]);
    const playAnim = (p1, p2) => {
        if (!spriteComp) return;
        if (hasAnim(p1)) spriteComp.play(p1);
        else if (p2 && hasAnim(p2)) spriteComp.play(p2);
    };

    // WALL SLIDE LOGIC
    if (!noChao && this.entidade.velocidadeY > 0 && ((this.paredeEsq && pressEsq) || (this.paredeDir && pressDir))) {
       const colS = this.entidade.obterComponente("CollisionComponent");
       if(colS && this._defH > 0 && colS.altura !== this._crouchH) { colS.altura = this._crouchH; colS.offsetY = this._crouchOffY; }

       if (this.entidade.velocidadeY > this.velocidadeWallSlide) this.entidade.velocidadeY = this.velocidadeWallSlide;

       // SOM: Wall Slide (Prioridade: somWallSlide > somSlide)
       const somSlideFinal = this.somWallSlide;
       const pitchSlideFinal = this.somWallSlide ? this.pitchWallSlide : 1.0;
       this.audioWallSlideInstancia = this.tocarSom(somSlideFinal, true, this.audioWallSlideInstancia, pitchSlideFinal);

       if (this.paredeEsq) this.entidade.velocidadeX = -10;
       if (this.paredeDir) this.entidade.velocidadeX = 10;

       if (hasAnim("wallslide")) spriteComp.play("wallslide");
       else if (hasAnim("wall_slide")) spriteComp.play("wall_slide");
       else if (hasAnim("slide")) spriteComp.play("slide");
       else if (hasAnim("escalando")) spriteComp.play("escalando");

       if (spriteComp) {
           if (!this.isVisualSliding) {
               this.defaultOffsetX = spriteComp.offsetX || 0;
               this.isVisualSliding = true;
           }
           if (this.paredeDir) { spriteComp.inverterX = false; spriteComp.offsetX = Number(this.defaultOffsetX) + Number(this.offsetWallDir); }
           if (this.paredeEsq) { spriteComp.inverterX = true; let rawVal = Number(this.defaultOffsetX) + Number(this.offsetWallEsq); if(isNaN(rawVal)) rawVal=0; spriteComp.offsetX = rawVal; }
       }

       // WALL JUMP
       if (pressJump) {
            this.entidade.velocidadeY = -this.forcaPulo;
            // SOM: Pulo
            this.tocarSom(this.somPulo);

            if (this.paredeEsq) this.entidade.velocidadeX = 300;
            if (this.paredeDir) this.entidade.velocidadeX = -300;
            // Reset Collider & Visual
            if(colS && this._defH > 0) { colS.altura = this._defH; colS.offsetY = this._defOffY; }
            if (this.isVisualSliding && spriteComp) { spriteComp.offsetX = this.defaultOffsetX; this.isVisualSliding = false; }
            // Stop Wall Sound
            this.pararSom(this.audioWallSlideInstancia); this.audioWallSlideInstancia = null;
       }

    } else {
       // NOT SLIDING: Reset Logic
       this.pararSom(this.audioWallSlideInstancia); this.audioWallSlideInstancia = null;

       if (this.isVisualSliding && spriteComp) { spriteComp.offsetX = this.defaultOffsetX; this.isVisualSliding = false; }
       const colS = this.entidade.obterComponente("CollisionComponent");
       if(colS && this._defH > 0 && colS.altura !== this._defH) { colS.altura = this._defH; colS.offsetY = this._defOffY; }

       // JUMP NORMAL
       if (noChao && pressJump) {
           this.entidade.velocidadeY = -this.forcaPulo;
           this.tocarSom(this.somPulo);
           this.foiNoChao = false;
       }

       // Animations
       if (noChao) {
           if (vx === 0) {
               if(pressDown) {
                   playAnim("crouch", "agachar");
                   // [Collider Resize: Ground]
                   const colG = this.entidade.obterComponente("CollisionComponent");
                   if (colG) {
                       if (!this._defH) { this._defH = colG.altura; this._crouchH = colG.altura * 0.5; this._defOffY = colG.offsetY; this._crouchOffY = colG.offsetY + (colG.altura * 0.5); }
                       if (colG.altura !== this._crouchH) { colG.altura = this._crouchH; colG.offsetY = this._crouchOffY; }
                   }
               } else {
                   playAnim("idle", "parado");
                   // [Collider Restore]
                   const colG = this.entidade.obterComponente("CollisionComponent");
                   if (colG && this._defH && colG.altura !== this._defH) { colG.altura = this._defH; colG.offsetY = this._defOffY; }
               }
           } else {
               if (pressDown) {
                    playAnim("slide", "crouch_walk");

                    this.pararSom(this.audioAndarInstancia); this.audioAndarInstancia = null;
                    this.pararSom(this.audioCorridaInstancia); this.audioCorridaInstancia = null;
               } else {
                    if(correndo) playAnim("run", "correr");
                    else playAnim("walk", "andar");
               }
           }
       } else {
           if (this.entidade.velocidadeY < 0) playAnim("jump", "pulo");
           else playAnim("fall", "cair");
       }
       if (spriteComp) {
           if (vx > 0) spriteComp.inverterX = false;
           if (vx < 0) spriteComp.inverterX = true;
       }
    }
  }
  atualizar(deltaTime) {
      this.entidade.x += this.entidade.velocidadeX * deltaTime;
      this.entidade.y += this.entidade.velocidadeY * deltaTime;
  }
  // Methods exposed for audio stop on destroy/disable
  onDestroy() {
      this.pararSom(this.audioAndarInstancia);
      this.pararSom(this.audioWallSlideInstancia);
  }
}

class SimuladorMorte {
